import React from 'react';
import { FooterStyled } from './footer.styled';



const Footer = () => {
  return (
    <FooterStyled>
      <ul>
        <li>inbox@albert-dm.dev</li>
        <li>Automation and Software Developer</li>
        <li>albert-dm.dev-2020</li>
      </ul>
    </FooterStyled>
  );
};

export default Footer;
